import React from 'react';

type Button = {
    name:string;
    started:()=>void
    value?:number;
}


const  ButtonStyle = {
    color:'blue',
    height:'30px',
    width:'50px',
    borderRadius:'8px',
    fontFamily: "Monotype Corsiva",
    fontSize: '20px',
    fontStyle: 'italic',
}


export  const Button = (props:Button) => {
    return (
        <span >
            <button style={ButtonStyle}  disabled={props.value===5} onClick={props.started}>{props.name}</button>
        </span>
    );
};
